    constructor() {
        super();
        this.state={}
    }
    
    render() {
        return(
            <div className={"Homepage"}>
                <img alt={"标本"}  className={"addtoimg"} src={"/img/FsxN7RUFRJ9Zdris5Z22haR2xIhj?50X50&imageView2/1/w/50/h/50"}/>
                <br/>
                <span>首页</span>
            </div>
        )
    }
}

export default withRouter(Homepage);
